import React from 'react';
import Tile from './components/Tile';
import data from "./components/data"

export default function App() {
    const grid = data.map(row => {
        return(
            row.sudoku.map(tile =>{
                return( <Tile number={tile}/>)
            })

        )
    })
    return (
        <div>
            {grid}
        </div>
    );
}
